import React from 'react';
import { MDBCard, MDBCardBody, MDBCardHeader, MDBInput, MDBBtn, MDBTable, MDBTableBody, MDBTableHead  } from 'mdbreact';

const TablePanel = (props) => {
  const data_panel = {
    columns: [
      {
        'field': 'p1',
        'sort': 'asc'
      },
      {
        'field': 'paid',
        'sort': 'asc'
      },
      {
        'field': 'p2',
        'sort': 'asc'
      },
      {
        'field': 'amount',
        'sort': 'asc'
      }
    ],
    rows: [
      {
        'p1': 'Mark',
        'paid': "paid",
        'p2': 'Otto',
        'amount': '$3.99'
      },
      {
        'first': 'Jacob',
        'last': 'Thornton',
        'amount': '$3.99'
      },
      {
        'first': 'Larry',
        'last': 'the Bird',
        'amount': '$3.99'
      },
      {
        'first': 'Paul',
        'last': 'Topolski',
        'amount': '$3.99'
      },
      {
        'first': 'Larry',
        'last': 'the Bird',
        'amount': '$3.99'
      }
    ]
  };

  return(

    <MDBCard narrow style={{marginTop:"10px",width:"40%"}}>
      <MDBCardHeader className="view view-cascade gradient-card-header info-color d-flex justify-content-between align-items-center py-2 mx-0 mb-0">
        <div>
          <MDBBtn outline rounded size="sm" color="white" className="px-2">
            <i className="fa fa-th-large mt-0"></i>
          </MDBBtn>
          <MDBBtn outline rounded size="sm" color="white" className="px-0">
            <i className="fa fa-columns mt-0"></i>
          </MDBBtn>
        </div>
        <a href="#" className="white-text mx-3">Transaction History</a>
        <div>
          <MDBBtn outline rounded size="sm" color="white" className="px-2">
            <i className="fas fa-pencil-alt mt-0"></i>
          </MDBBtn>
          <MDBBtn outline rounded size="sm" color="white" className="px-2">
            <i className="fas fa-times mt-0"></i>
          </MDBBtn>
          <MDBBtn outline rounded size="sm" color="white" className="px-2">
            <i className="fa fa-info-circle mt-0"></i>
          </MDBBtn>
        </div>
      </MDBCardHeader>
      <MDBCardBody cascade>
        <MDBTable btn fixed>
          <MDBTableHead columns={data_panel.columns} />
          <MDBTableBody rows={data_panel.rows} />
        </MDBTable>
      </MDBCardBody>
    </MDBCard>
  );
};

export default TablePanel;
